import React from 'react';

const SubmitButton = ({ selectedOptions, jsonData }) => {
  const checkAnswers = () => {
    let score = 0;
    selectedOptions.forEach((selectedOption, questionIndex) => {
      const answer = jsonData[questionIndex].answer[0];
      if (selectedOption === answer) {
        score++;
      }
    });
    console.log(`Score: ${score}`);
  };

  return (
    <button className="submit-button" onClick={checkAnswers}>
      <strong>Submit</strong>
    </button>
  );
};

export default SubmitButton;
